func (r *MoqError_Temporary_fnRecorder) FindResults() {
	r.Moq.Scene.T.Helper()
	if r.Results != nil {
		r.Results.Repeat.Increment(r.Moq.Scene.T)
		return
	}

	anyCount := bits.OnesCount64(r.AnyParams)
	insertAt := -1
	var results *MoqError_Temporary_resultsByParams
	for n, res := range r.Moq.ResultsByParams_Temporary {
		if res.AnyParams == r.AnyParams {
			results = &res
			break
		}
		if res.AnyCount > anyCount {
			insertAt = n
		}
	}
	if results == nil {
		results = &MoqError_Temporary_resultsByParams{
			AnyCount:  anyCount,
			AnyParams: r.AnyParams,
			Results:   map[MoqError_Temporary_paramsKey]*MoqError_Temporary_results{},
		}
		r.Moq.ResultsByParams_Temporary = append(r.Moq.ResultsByParams_Temporary, *results)
		if insertAt != -1 && insertAt+1 < len(r.Moq.ResultsByParams_Temporary) {
			copy(r.Moq.ResultsByParams_Temporary[insertAt+1:], r.Moq.ResultsByParams_Temporary[insertAt:0])
			r.Moq.ResultsByParams_Temporary[insertAt] = *results
		}
	}

	paramsKey := r.Moq.ParamsKey_Temporary(r.Params, r.AnyParams)

	var ok bool
	r.Results, ok = results.Results[paramsKey]
	if !ok {
		r.Results = &MoqError_Temporary_results{
			Params:  r.Params,
			Results: nil,
			Index:   0,
			Repeat:  &moq.RepeatVal{},
		}
		results.Results[paramsKey] = r.Results
	}

	r.Results.Repeat.Increment(r.Moq.Scene.T)
}

func (r *MoqError_Temporary_fnRecorder) Repeat(repeaters ...moq.Repeater) *MoqError_Temporary_fnRecorder {
	r.Moq.Scene.T.Helper()
	if r.Results == nil {
		r.Moq.Scene.T.Fatalf("ReturnResults or DoReturnResults must be called before calling Repeat")
		return nil
	}
	r.Results.Repeat.Repeat(r.Moq.Scene.T, repeaters)
	last := r.Results.Results[len(r.Results.Results)-1]
	for n := 0; n < r.Results.Repeat.ResultCount-1; n++ {
		if r.Sequence {
			last = struct {
				Values *struct {
					Result1 bool
				}
				Sequence   uint32
				DoFn       MoqError_Temporary_doFn
				DoReturnFn MoqError_Temporary_doReturnFn
			}{
				Values:   last.Values,
				Sequence: r.Moq.Scene.NextRecorderSequence(),
			}
		}
		r.Results.Results = append(r.Results.Results, last)
	}
	return r
}

